『カンナビス・サティヴァ・ジン』﻿
原産地：オランダ﻿
度数：40％﻿
内容量：700ml﻿
﻿
3人のオランダの起業家たちが、アムステルダムのバーからカンナビスのテイストが消えたことを憂慮したことがきっかけとなり作られた、カンナビスフレーバーのジン。﻿
﻿
﻿
この商品の名前ですが冒頭で紹介した通り『カナビス・ジン』と言われることも多いです。﻿
﻿
※カナビス＝大麻  を意味する言葉ですが﻿
向精神効果を生み出す有効成分であるTHC（テトラヒドロカンナビノール）はもちろん含まれていません。﻿
﻿
﻿
正式名称『カンナビス・サティヴァ・ジン』﻿
つまり、商品名でもあるカンナビス・サティヴァとは学名で麻（アサ）のこと。 ﻿
このジンは『大麻の原料』としても知られる麻を用いて作られたジンというわけです!﻿
﻿
『カナビス』と『カンナビス・サティヴァ』では意味が違ってくるので要注意ですね💦﻿
﻿
﻿
はっきりとした草本的で苦い香りの強い、純粋で持続的な味が特徴。﻿
スパイシーなアクセント、バニラの甘いタッチ、カルダモンのスパイシーなニュアンス。﻿
﻿
